                    date: "Late 2020 - Mid 2021",
                    target: "Sell future Qs to investors for at least 100 million USD.",
                    more: {
                        p_1: "How to achieve it: It is expected that with a critical mass of buyers and sellers, the perceived likelihood of success will be high enough to attract significant investments, providing the required initial monetary reserves to instill trust in Q."
                    }
