                        text_3: ', clicking the "Settings" option at the bottom of the page, and choosing the "Close Account" option. All data will be erased, and we will not be able to restore it under any circumstances. Please note that once you close your account you will lose any Qs associated with that account, and you will no longer be able to invite or verify friends from that account.'
