                        text_5: "BY USING THIS SITE, YOU EXPRESSLY ASSUME ALL RISK THAT THE INFORMATION AND MATERIALS ON THIS SITE MAY BE INCOMPLETE, INACCURATE, OUT-OF-DATE, OR MAY NOT MEET YOUR NEEDS OR REQUIREMENTS.",
