                    worth1: "Cada miembro de la red Q quiere saber qu tan valiosas pueden llegar a ser las Q. Si la Iniciativa Q logra crear una red de pago lder en el mundo, se espera que las Q reservadas en la actualidad para los miembros se otorguen con el tiempo por un valor aproximado de un dlar estadounidense por cada Q.",
