                    economic_activity_text_3: " los compradores y vendedores lo preferirn a las tarjetas de crdito. Por lo tanto, el volumen minorista de Q se proyecta entre 5 y 20 billones de dlares, suponiendo que sea adoptado con xito en todo el mundo.",
