                    h3_value_of_one: "Valor de una Q",
                    h3_value_of_one_text: "Las recompensas Q reservadas actualmente provienen de un suministro total de ",
                    h3_value_of_one_link: "2 billones de Q",
                    h3_value_of_one_text_1: ". Esto significa que las recompensas estarn disponibles para su uso a una tasa de un dlar por Q, una vez que todos las Q alcancen un valor de 2 billones de dlares estadounidenses, una estimacin realista suponiendo una adopcin a gran escala, como se muestra arriba.",
                    monetary_policy_1: "Toda moneda necesita una poltica monetaria slida para mantener la confianza del pblico en su estabilidad a largo plazo. Una moneda cuyo valor econmico flucta con rapidez complica el comercio y las finanzas, perjudica la economa y con el tiempo obliga a las personas a utilizar otras monedas.",
