                    monetary_policy_2_2: " de forma indirecta, a travs de incentivos otorgados por ",
                    monetary_policy_2_link_3: "los bancos centrales",
                    monetary_policy_2_3: " a los bancos privados.",
                    monetary_policy_3: "La Iniciativa Q tambin necesita una poltica monetaria para mantener la estabilidad de la moneda, pero como moneda electrnica global, no est sujeta a estas limitaciones histricas, y puede utilizar instrumentos monetarios ms avanzados a la vez que se basa en datos econmicos precisos en tiempo real. Estos instrumentos monetarios se detallan a continuacin.",
                    monetary_policy_4: "Cabe sealar que la poltica monetaria de la Iniciativa Q ser supervisada en ltima instancia por un comit monetario que rendir cuentas directamente a todos los titulares de Q y que ser independiente de la entidad corporativa de la Iniciativa Q.",
                    h3_circulation: "Control de las Q en circulacin",
                    circulation_1: "El propsito de la red de pago Q es facilitar el comercio de manera ms eficiente que los sistemas de pago y las monedas actuales. Esto hace necesario que la Q tenga un valor, de modo que los precios se mantengan en promedio bastante constantes y predecibles.",
                    circulation_1_sup: "3",
