                    circulation_1_sup_text_link: "https://web.archive.org/web/20181106174256/https://www.hoover.org/sites/default/files/research/docs/17104-bordo-levin_updated.pdf",
                    circulation_1_sup_text_2: " p. 4.",
                    circulation_2: "Para lograr este objetivo, las Q de recompensa reservadas para cada miembro se emitirn para su uso gradual, a un ritmo que coincida con el crecimiento de la actividad econmica en la red, al tiempo que se mantiene un tipo de cambio objetivo de un dlar estadounidense por Q.",
                    h3_instruments: "Instrumentos monetarios",
                    instruments_sub_title: "Los principales instrumentos monetarios de Q:",
                    instruments_text_1_b: "Emisin de Q:",
                    instruments_text_1: " los miembros que participen en la Iniciativa Q pueden reservar Q de forma gratuita, con un nmero especfico que vara en funcin de la anticipacin con la que se unan. Estas Q se irn emitiendo paulatinamente a medida que crezca la actividad econmica, lo que permitir su utilizacin en la red Q y aumentando as la oferta monetaria activa actual.",
                    instruments_text_2_b: "Incentivos a la actividad:",
                    instruments_text_2: " se pueden emitir Q adicionales para incentivar actividades que promuevan el crecimiento de la red, tales como una recompensa en efectivo en las compras, un bono en la conversin de otras monedas, etc. Esto crea efectivamente un descuento en las compras basadas en Q, lo que a su vez atrae la actividad econmica, que a su vez requiere la emisin de ms Q y as sucesivamente. Este circuito de retroalimentacin positiva podra impulsar el rpido crecimiento de la red hasta que se convierta en un estndar de pago y pueda crecer nicamente en funcin de sus ventajas tecnolgicas.",
                    instruments_text_3_b: "Operaciones de mercado abierto:",
                    instruments_text_3: " el comit puede aumentar o disminuir la cantidad de Q en circulacin comprando o vendiendo directamente Q a cambio de otras monedas. El comit tambin puede vender futuros otorgamientos de Q, a una tasa de descuento, a inversionistas acreditados. Estas Q se emitirn a medida que crezca la actividad econmica, de forma similar a las Q reservadas para los miembros nuevos.",
                    instruments_text_4: "En general, estos instrumentos monetarios ofrecen un control mucho mejor y ms directo de la oferta monetaria que los utilizados por los bancos centrales actuales. Los bancos centrales estn sujetos a las limitaciones histricas del sistema de encaje fraccionario, un sistema que les obliga a operar a travs de bancos privados. Esto se traduce en largos ciclos de respuesta y en una inflacin impredecible.",
                    h3_money_supply: "Oferta de dinero",
                    money_supply_text_1: "La oferta de dinero debe coincidir con la actividad econmica para mantener estable el poder adquisitivo. Por lo tanto, dado que la actividad econmica no tiene tope, la cantidad de Q tambin debera tenerlo. ",
                    money_supply_text_2: "Sin embargo, es sumamente importante que la oferta monetaria slo crezca en proporcin al crecimiento de la demanda de Q, y no por otros motivos. Por ejemplo, los gobiernos que imprimieron dinero con abandono para financiar sus presupuestos (y al hacerlo transfirieron riqueza de los ciudadanos a las cuentas del gobierno devaluando la moneda de los ciudadanos) crearon ",
                    money_supply_text_2_link: "hiperinflacin",
                    money_supply_text_2_1: ", y a la larga hicieron que su moneda no valiera nada.",
                    money_supply_text_3: "As, aunque tericamente ilimitado, el suministro Q se controla en la prctica. Esto se hace nicamente a travs de instrumentos monetarios que slo pueden utilizarse para los objetivos de mantener la estabilidad monetaria y promover la adopcin.",
                    h3_monetary_committee: "Comit monetario",
                    h3_monetary_committee_text_1: "Lograr la estabilidad monetaria implica un cuidadoso anlisis y prediccin de la actividad econmica, as como la consideracin de factores psicolgicos de masas. Esto, lamentablemente, sigue estando fuera del alcance de las computadoras y exige la participacin de profesionales humanos. As es como se gestionan las monedas gubernamentales, lo cual ha permitido que las principales monedas demuestren hoy en da una estabilidad a largo plazo mucho mejor que la de Bitcoin y otras criptomonedas. Sin embargo, la Iniciativa Q podra superar esto con una gestin ms orientada y mejor incentivada.",
                    h3_monetary_committee_text_2: "Para satisfacer esta necesidad, la Iniciativa Q contar con un comit monetario independiente de la entidad corporativa de la Iniciativa Q, que ser nombrado mediante votacin por todas las partes interesadas en la red de pago de la Iniciativa Q. Este comit ser el encargado de establecer y ejecutar la poltica monetaria: determinar cuntas Q se agregarn o quitarn de circulacin, y a travs de qu instrumentos monetarios. Los miembros del comit monetario recibirn un incentivo econmico para cumplir sus objetivos vinculando la remuneracin al desempeo.",
                    h3_monetary_committee_text_2_sup: "4",
                    h3_monetary_committee_text_2_sup_text: "Existen precedentes de ello; por ejemplo, en virtud de la Ley del Banco de Reserva de Nueva Zelanda de 1989, el gobernador del banco central poda ser despedido si no cumpla el objetivo de inflacin.",
                    h3_monetary_committee_text_3: "Dado que el comit monetario de la Iniciativa Q tiene acceso a datos econmicos en tiempo real y tiene control directo de la oferta monetaria, sus polticas pueden ser ms cientficas y transparentes que los sistemas actuales. En la medida de lo posible, los resultados del comit se expresarn como reglas y funciones que dictan las medidas monetarias que se han de adoptar en funcin de diversos parmetros econmicos (similares a la ",
                    h3_monetary_committee_text_3_link: "regla de Taylor de la actualidad",
                    h3_monetary_committee_text_3_1: "). Estos se actualizarn gradualmente de acuerdo con los nuevos conocimientos, alcanzando con el tiempo un estado estable en el que la poltica sea casi automtica, aunque con un seguimiento constante para detectar anomalas.",
                    h3_monetary_committee_text_4: "Como un medio adicional para infundir confianza en el poder adquisitivo a largo plazo de Q, el comit monetario se ofrecer comprar Q de forma continua a cambio de USD (y otras monedas) a la tasa objetivo de 1 Q por USD 1. Esto garantizar que los vendedores puedan aceptar la Q como mtodo de pago.",
                    h3_monetary_committee_text_4_sup: "5",
                    h3_monetary_committee_text_4_sup_text: "Dado que Q tiene un objetivo de inflacin del 0 %, su tipo de cambio frente al dlar estadounidense u otras monedas debe aumentar paulatinamente.",
                    h3_monetary_committee_text_5: "Esto hace necesario que el comit monetario mantenga grandes reservas de USD. El saldo de la reserva estar a disposicin del pblico, lo que garantiza a los miembros que puedan convertir a USD en cualquier momento, respaldando as la estabilidad de Q. A medida que Q se convierta en un estndar global y aumente la confianza en su valor a largo plazo, la proporcin de reservas puede disminuir.",
                    h3_monetary_committee_text_6: "Estas reservas se financian a travs de dos fuentes:",
                    h3_monetary_committee_bullet_b_1: "Venta de Q por USD",
                    h3_monetary_committee_bullet_1: " - Los compradores que deseen beneficiarse de las ventajas de la red de pago Q deben aadir Qs en su cuenta, lo que se hace comprndolas al comit monetario.",
                    h3_monetary_committee_bullet_b_2: "Venta de futuras emisiones de Q",
                    h3_monetary_committee_bullet_2: " - Esta opcin est disponible para los inversores acreditados que crean en el xito a largo plazo de la Iniciativa Q. Pueden comprar (con un descuento considerable) el derecho a recibir Q en el futuro, que se emitirn de acuerdo con el crecimiento de la red, similar a las recompensas de los miembros nuevos."
