                    costs_text_2: "Como a rede de pagamento Q usar um sistema e uma moeda unificados, e funcionar de forma digital utilizando a mais avanada tecnologia, as taxas de transao sero muito mais baixas. Alm disso, reduzindo tentativas de fraude e golpes, a Initiative Q tambm ",
