                    costs_text_2_1: ".",
                    universality_text: "A rede de pagamento Q oferece um sistema unificado para pagamentos, vendas e transferncias, que funciona instantaneamente em todos os lugares. A mesma moeda (Q)  usada em todos os territrios, evitando a necessidade do cmbio de moedas a taxas elevadas.",
                    h3_universality_blocks_1_title: "Mercado eficiente",
                    universality_blocks_1_text: "Hoje, uma grande parcela das compras ocorre como resultado das iniciativas de marketing do vendedor, embora quase todas essas iniciativas sejam malsucedidas. Isso significa que os consumidores so constantemente bombardeados com mensagens inteis que esgotam seu tempo e ateno e levam a um aumento no preo dos produtos.",
                    universality_blocks_1_text_2: "Atravs de anlises avanadas do perfil do comprador e do histrico de transaes, a Initiative Q pode transformar a dinmica do mercado: em vez de os vendedores convencerem os clientes de forma agressiva de que eles precisam dos produtos, o foco ser identificar as verdadeiras necessidades dos clientes e encontrar os produtos que melhor satisfaam essas necessidades.",
                    h3_universality_blocks_2_title: "Arquitetura",
                    universality_blocks_2_text: "A Initiative Q visa tornar-se a principal rede mundial de pagamento. Para isso,  necessrio estabelecer pontos comerciais em todo o mundo, cumprir os regulamentos locais e prestar servio de qualidade ao cliente.",
                    universality_blocks_2_text_2: "Para alcanar rapidamente esse objetivo, a Initiative Q focar apenas em tecnologia, normas e regulamentos, enquanto delegar a operao financeira para centenas de agentes locais. Esses agentes locais sero responsveis pelo atendimento ao cliente, a preservao dos fundos dos membros, a conexo de lojas locais, conformidade jurdica, e liquidao de saldo com outros agentes.",
                    h3_universality_blocks_3_title: "ALD - Antilavagem de dinheiro",
                    universality_blocks_3_text_1: "Uma das principais causas da complexidade nos pagamentos  a necessidade de cumprir os regulamentos de preveno da lavagem de dinheiro.  por isso que as transferncias internacionais podem levar vrios dias e custar de 20 a 100 dlares cada.",
                    universality_blocks_3_text_2: "A moeda Q  transacionada exclusivamente na rede Q e, portanto, cada Q pode ser rastreada at sua origem, eliminando a necessidade de procedimentos ALD e preparando o caminho para transferncias monetrias transfronteiras instantneas.",
                    h3_universality_blocks_4_title: "Monetizao de contedo",
                    universality_blocks_4_text: "As complexidades e custos dos atuais sistemas de pagamento impossibilitam os pequenos pagamentos imediatos de contedo, exigindo que os criadores de contedo dependam de receita proveniente de publicidade. Um sistema de pagamento digital universal e de baixo custo pode finalmente capacitar os usurios a consumirem contedo sem publicidade, cobrando-se um valor desprezvel, prximo ao que geraria um anncio (normalmente uma frao de centavo por pgina ou vdeo).",
                    process_block: "Os agentes competem entre si para gerenciar as contas dos membros (compradores ou vendedores), e recebem uma pequena taxa pelas transaes que eles processam. Uma tpica transao na rede de pagamento Q  processada da seguinte maneira:",
                    process_bullet_1: "O comprador vai a uma loja ou site do vendedor;",
                    process_bullet_2: "Se for on-line, o comprador escolhe a opo de pagamento Q, a qual  identificada pela rede de pagamento Q;",
                    process_bullet_3: "Se for em uma loja fsica, o aplicativo de smartphone Q do comprador conecta-se ao sistema de ponto de venda do vendedor, que envia os dados da transao para a rede de pagamento Q;",
                    process_bullet_4: "O aplicativo solicita a aprovao do comprador. Dependendo do porte e do risco da compra, poder ser acionada uma medida de segurana adicional (conforme descrito acima);",
                    process_bullet_5: "O agente do comprador  notificado a respeito da transao pela rede de pagamento Q;",
                    process_bullet_6: "O servidor do agente do comprador verifica se o comprador tem Qs (ou crdito) suficientes para efetuar a compra e, em caso afirmativo, notifica o agente do vendedor;",
                    process_bullet_7: "O vendedor  avisado de que a transao foi bem-sucedida e fornece o produto ou servio para o comprador;",
                    process_bullet_8: "Periodicamente, todos os agentes liquidam seu saldo devedor pela rede Q interna. Essa liquidao de saldo poder utilizar um registro na blockchain, aproveitando as vantagens da criptomoeda enquanto protege os clientes de suas muitas carncias (",
                    process_bullet_8_link: "leia mais sobre a Initiative Q e criptomoedas",
                    process_bullet_8_1: ").",
                    history_text_1: "As redes de pagamento atuais dependem de tecnologias ultrapassadas. Esto com dcadas de atraso em termos de segurana, facilidade de uso e emisso de relatrios e gerenciamento de crdito, resultando em taxas elevadas e custos indiretos. Com a distribuio de sua moeda aos primeiros adeptos, a Initiative Q supera as barreiras que impediram a adoo de muitas inovaes realizadas ao longo dos anos na rea de pagamentos. ",
                    history_text_2: "Quando um sistema globalizado mais rpido, seguro e fcil de usar estiver amplamente disponvel, rapidamente se tornar a forma de pagamento preferencial de compradores e vendedores."
