                        text_4: '"). Statistical Data helps understand trends and customer-needs so that new products and services can be considered and so existing products and services can be tailored to customer desires. Statistical Data is anonymous and aggregated and we will not link Statistical Data to any Personal Data. We may share such Statistical Data with our partners, without restriction, on commercial terms that we can determine in our sole discretion.',
                        text_5_title: "Analytics",
                        text_5: 'We, or our service providers or subcontractors, may use analytics tools ("',
                        text_5b: "Tools",
                        text_6: '"), including "Google Analytics" to collect data about the use of the Site and/or services. Such Tools collect data such as how often users visit the Site, what pages they visit when they do so, and what other sites and mobile applications they used prior to visiting the Site. The Tools may collect certain Personal Data, and may link such Personal Data to specific data stored in our customer database. We use the data we get from the Tools to improve our Site and services. Google\'s ability to use and share data collected by Google Analytics about your visits to this site is restricted by the Google Analytics Terms of Use located at ',
                        text_7: "https://web.archive.org/web/20181106174256/http://www.google.com/analytics/terms/us.html",
                        text_7_link: "https://web.archive.org/web/20181106174256/http://www.google.com/analytics/terms/us.html",
                        text_8: " and the Google Privacy Policy located at ",
                        text_9: "https://web.archive.org/web/20181106174256/http://www.google.com/policies/privacy/",
                        text_9_link: "https://web.archive.org/web/20181106174256/http://www.google.com/policies/privacy/",
