                        text_1: "The key points listed below are presented in further detail throughout this Privacy Notice. These key points do not substitute the full Privacy Notice.",
                        text_2b: "Personal Data We Collect.",
                        text_2: " When you register, we collect Personal Data provided by you, such as your name and email address. We collect Personal Data regarding who invited whom to register for our Site. We also (automatically) collect data about your use of the Site. If you contact us for questions or complaints, we will collect the data related to your inquiry.",
                        text_3b: "Basis for Processing Your Personal Data.",
                        text_3: " Processing your Personal Data is necessary for the performance of the Terms and the provision of the Services to you. Processing for the purposes of analytics and usage analysis and for our recordkeeping and protection of our legal rights  are all necessary for the purposes of legitimate interests that we pursue.",
                        text_4b: "How We Use the Data We Collect.",
                        text_4: " We use the data (including Personal Data) we collect mainly to administer and provide the Site, contact you with administrative information, including in connection with our future payment system for which you can sign up, as well as to improve the Site.",
                        text_5b: "Sharing the Personal Data We Collect.",
                        text_5: " We may share the Personal Data we collect with our service providers and subcontractors who assist us in the operation of the Site and process the data on our behalf and under our instructions.",
                        text_6b: "International Transfer.",
                        text_6: " We may use service providers and/or subcontractors and/or cooperate with or have business partners and affiliates located in countries other than your own, and send them your Personal Data. We will ensure to have agreements in place with such parties ensuring the same level of privacy and data protection as set forth in this Privacy Notice. You hereby consent to such international transfer.",
                        text_7b: "Your Rights.",
                        text_7: " Subject to applicable law and additional rights as set forth below, you may have a right to access, update and/or delete your Personal Data and obtain a copy of the Personal Data we have collected about you.",
                        text_8b: "Use of Cookies and Similar Technologies.",
                        text_8: " We use cookies and similar technologies to help personalize your experience. You can adjust your settings to determine which cookies you do or do not allow. Changing your settings and/or deleting existing cookies may affect the Services.",
