                        text_1: "We may share your data, including Personal Data, as follows:",
                        text_2_title: "Business Partners, Service Providers, Affiliates, and Subcontractors",
                        text_2: "We may disclose data, including Personal Data we collect from and/or about you, to our trusted service providers, business partners, affiliates, subcontractors, who may use such data to: (1) help us provide you with the Site and/or services; and (2) aid in their understanding of how users are using our Site and/or services.",
