                        text_4_title: "Business Transfers",
                        text_4: "We may transfer our databases containing your Personal Data if we sell our business or part of it, including in cases of liquidation. Data about our users, including Personal Data, may be disclosed as part of, or during negotiations of, any merger, sale of company assets or acquisition and shall continue being subject to the provisions of this Privacy Notice.",
